INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(35, 2, 'التفاح الأحمر العضوي لذيذ', '&lt;p&gt;واشنطن التفاح هي مصدر طبيعي للألياف وخالية من الدهون. أنها تحتوي على مضادات الأكسدة والمواد المغذية. السعرات الحرارية من واشنطن أبل هو 95. هذه التفاح واشنطن هي ، هش ثمار البشرة الحمراء ، ناعمة ، العصير. يتذوق لحم هذه التفاحة طعمًا مقرمشًا وعصيرًا مع نكهة حلوة سكرية.&lt;br&gt;&lt;/p&gt;\r\n', '', 'التفاح الأحمر العضوي لذيذ', '', ''),
(48, 2, 'جاف المكسرات المحمص مع ملح البحر', '&lt;div class=&quot;cpt_product_description &quot;&gt;\r\n	&lt;div&gt;\r\n		&lt;p&gt;&lt;b&gt;صحي ولذيذ غني في التغذية يمكن إضافته إلى الفطائر ، والحلويات ، والكعك ، إلخ. وجبة خفيفة لإشباع آلام الجوع&lt;/b&gt;&lt;br&gt;&lt;/p&gt;\r\n	&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;!-- cpt_container_end --&gt;', '', 'جاف المكسرات المحمص مع ملح البحر', '', ''),
(40, 2, 'تفحم الكاجو الجامع', '&lt;p class=&quot;intro&quot;&gt;حبات الجوز ذات الجودة العالية مصدر غني بالبروتين والألياف ومضادات الأكسدة جوزي حلو المذاق حلو المذاق مثالي لتناول الوجبات الخفيفة والطهي والخبز إضافة ممتازة للحلويات ، الهزات إلخ.&lt;br&gt;&lt;/p&gt;\r\n', '', 'تفحم الكاجو الجامع', '', ''),
(28, 2, 'الكاجو العنقودية', '&lt;p&gt;مصدر جيد للبروتين. مصدر جيد للألياف. خالي من الغلوتين. موافق للشريعة اليهودية&lt;br&gt;&lt;/p&gt;&lt;ul&gt;\r\n&lt;/ul&gt;\r\n', '', 'الكاجو العنقودية', '', ''),
(44, 2, 'الموز العضوي', '&lt;div&gt;يعتبر الموز من أكثر الفواكه المغذية اقتصاديًا والمأكولة على نطاق واسع ، ويقدم لكم Fresho مجموعة مختارة من أفضل أنواع الفواكه. تم اختيار الموز من أفضل البساتين في جميع أنحاء البلاد ، وقد حان وقته ويأتي مع جلد أصفر نابض بالحياة ، يحمي مغذيته.&lt;br&gt;&lt;/div&gt;\r\n', '', 'الموز العضوي', '', ''),
(45, 2, 'ترايدنت ألاسكا سمك السلمون البرغر', '&lt;div class=&quot;cpt_product_description &quot;&gt;\r\n	&lt;div&gt;\r\n		&lt;p&gt;&lt;b&gt;جعل البرغر أحب كثيرا باستخدام ماكدون Veggie برغر باتي. مصنوع من مزيج رائع من الخضار الطازجة والبطاطس المهروسة ، ويتم إعداده بشكل خفيف بالتوابل ومغطى بفتات الخبز المقرمشة. نقلي أو نخبز أو نطبخ الباتي ونعالج البرجر المثالي.&lt;/b&gt;&lt;br&gt;&lt;/p&gt;\r\n	&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;!-- cpt_container_end --&gt;', '', 'ترايدنت ألاسكا سمك السلمون البرغر', '', ''),
(74, 2, 'جبن البيتزا', '&lt;p&gt;جعل البرغر أحب كثيرا باستخدام ماكدون Veggie برغر باتي. مصنوع من مزيج رائع من الخضار الطازجة والبطاطس المهروسة ، ويتم إعداده بشكل خفيف بالتوابل ومغطى بفتات الخبز المقرمشة.&lt;br&gt;&lt;/p&gt;', '', 'جبن البيتزا', '', ''),
(75, 2, 'انجوس تشيز برجر', '&lt;p&gt;بيير أنجوس برجر الجبن يبدأ مع لحوم البقر USDA اختيار الذي يحدد معيار للنكهة والعصائر والحنان. شعلة اللحم مشوية إلى الكمال ، فطائر شرائح اللحم البقري لدينا تكملها طبقة من الجبن الأمريكي ويتم تقديمها على لفائف خميرة بذور السمسم كايزر - جاهزة للخدمة في ثوانٍ. اختيار ذكي لأسلوب حياة مزدحم ، وشواية بيير المشوية ، وبرغر أنجوس المطبوخ المطبوخ بشكل كامل من المؤكد أن تصبح المفضل لديك! يمكنك الحصول على الخير من الشوي دون الانتظار!&lt;br&gt;&lt;/p&gt;', '', 'انجوس تشيز برجر', '', ''),
(76, 2, 'البيض والجبنة كرواسان', '&lt;p&gt;استمتع بالمذاق اللذيذ لسمك ماكين بطاطس تشيز شوتز ، الذي يتكون من مزيج رائع من البطاطس والجبن والأعشاب. مطبوخ في فتات الخبز الذهبية المقرمشة ، هذه الطعم أفضل عند تقديمها ساخنة مع المايونيز ، صلصة الفلفل التايلاندي أو بودينا الصلصة المحبوبة.&lt;br&gt;&lt;/p&gt;', '', 'البيض والجبنة كرواسان', '', ''),
(29, 1, 'Haagen-Dazs', '&lt;p&gt;Vanilla Ice Cream: Cream, Skim Milk, Sugar, Egg Yolks, Vanilla Extract. Milk Chocolate and Vegetable Oil Coating with Almonds: Milk Chocolate (Sugar, Whole Milk Powder, Chocolate, Cocoa Butter, Soy Lecithin, Vanilla Extract), Almonds Roasted in Vegetable Oil (Almonds, Safflower Oil), Coconut Oil.&lt;br&gt;&lt;/p&gt;&lt;ul&gt;\r\n&lt;/ul&gt;\r\n', '', 'Haagen-Dazs', '', ''),
(36, 2, 'اللوز وبراوني المجمدة الحلوى', '&lt;div&gt;\r\n	&lt;p&gt;&lt;b&gt;جدران كوالتي ماغنوم - ميني كلاسيك ، اللوز وبراوني حلويات مجمدة&lt;/b&gt;&lt;br&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n', '', 'اللوز وبراوني المجمدة الحلوى', '', ''),
(61, 2, 'الإفطار ساندويتش الخبز', '&lt;p&gt;&lt;font color=&quot;#333333&quot; face=&quot;Celias, Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;يتم بذل كل جهد للحفاظ على دقة جميع المعلومات. ومع ذلك ، قد تحتوي مواد ومواد التعبئة الفعلية على معلومات أكثر و / أو مختلفة. يوصى بعدم الاعتماد فقط على المعلومات المقدمة.&lt;/span&gt;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', '', 'الإفطار ساندويتش الخبز', '', ''),
(47, 2, 'جرس فلفل مشكل', '&lt;p&gt;الفليفلة الصفراء هي ثلاث أو أربع فصوص من فصيلة الفليفلة. وتحيط الجدران السميكة بجوفاء كبيرة وشرائح التي تعلق بذورها ل. فهي خفيفة في النكهة من العديد من الفلفل وهكذا يتم التعرف عليها مثل الفلفل الحلو. هذه هي مورد جيد من الفيتامينات A و C وتوريد الألياف الغذائية.&lt;br&gt;&lt;/p&gt;\r\n', '', 'جرس فلفل مشكل', '', ''),
(32, 2, 'البارات العضوية الفادج', '&lt;p&gt;&lt;b&gt;يتم تحسين Kwality الجدران دسم لذيذ حلوى الأناناس المجمدة مع قطع فاكهة الأناناس الحقيقية. إنها ناعمة ومرنة للغاية. الجميع سوف يحبون هذه الحلوى.&lt;/b&gt;&lt;br&gt;&lt;/p&gt;\r\n', '', 'البارات العضوية الفادج', '', ''),
(41, 2, 'الجزر العضوي المقشر', '&lt;div&gt;Fresho هي علامتنا التجارية من الفواكه والخضروات الطازجة التي يتم انتقاؤها بشكل فردي كل يوم من قبل المشترين ذوي الخبرة لدينا من ذوي الخبرة الفنية. تم تصميم عمليات الشراء والتخزين والتعبئة لضمان وصول المنتجات الطازجة والمغذية والصحية واللذيذة إلى عتبة منزلك. نحن نضمن جودة جميع منتجات Fresho. إذا لم تكن راضيًا عن نضارة العناصر ، يمكنك إعادتها إلى مسؤول تجارب العملاء (CEE) لاسترداد المبلغ كاملاً. الجزر الطفل هي الجزر التي لا تزرع بالكامل. وهي تشبه الجزر العادية إلا أنها أصغر حجمًا.&lt;br&gt;&lt;/div&gt;\r\n', '', 'الجزر العضوي المقشر', '', ''),
(33, 1, ' Honey Roasted Nut ', '&lt;div&gt;\r\n	Also known as Supari in Hindi Can be used as fresh, dried, boiled, roasted or fermented Ideal to be added to the pan with other ingredients like slaked lime, catechu, gulkand etc. Traditionally used as a part of ritual.&lt;/div&gt;\r\n', '', ' Honey Roasted Nut ', '', ''),
(34, 2, 'Gits جلاب جامون حلويات ميكس', '&lt;div&gt;&lt;b&gt;يمنحك جيتس جولمان ميكس تجربة جذابة ومليئة بالحيوية. مصنوعة من مواد حليب أكثر صلابة ، فهي تعد فتات الجلاب التقليدية ذات المذاق اللذيذ مع المذاق الأصيل. تتمتع هذه الحلوى المميزة ، جاهزة في بضع دقائق مع هذا المزيج الفوري.&lt;/b&gt;&lt;br&gt;\r\n&lt;/div&gt;\r\n', '', 'Gits جلاب جامون حلويات ميكس', '', ''),
(43, 2, 'الطماطم كامباري', '&lt;div&gt;\r\n	&lt;p&gt;&lt;b&gt;الطماطم (الطماطم) هو طعام شائع ومثير للدهشة والذي يأتي في العديد من الأصناف المختلفة التي تختلف في الشكل واللون والحجم. هناك طماطم صغيرة صغيرة ، طماطم إيطالية على شكل كمثرى ، طماطم صفراء زاهية ، والطماطم الخضراء. الليكوبين هو المادة التي تزود الطماطم باللون الأحمر الغني والطماطم هي أفضل مصادر الليكوبين ، وهو مضاد قوي للأكسدة والطماطم المطبوخة بلمسة من الزيت يعطي المزيد من الليكوبين من الطماطم الخام.&lt;/b&gt;&lt;br&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n', '', 'الطماطم كامباري', '', ''),
(62, 2, 'قطعة الشوكولاته الكوكيز', '&lt;p&gt;الكوكيز الخفيفة والمقرمشة والمقرمشة.تتميز بالكمال بأناقة حرفية.متحملة بشكل رائع مع قضم الكاجو.الذي يتميز بالذهبي البني المميّز في اللون. يجعل وجبة خفيفة مرضية أو مرافقة للشاي في الوقت المناسب.&lt;br&gt;&lt;/p&gt;', '', 'قطعة الشوكولاته الكوكيز', '', ''),
(31, 2, 'مصنع تشيز كيك', '&lt;div class=&quot;cpt_product_description &quot;&gt;\r\n	&lt;div&gt;&lt;div&gt;يتم تحسين Kwality الجدران دسم لذيذ حلوى الأناناس المجمدة مع قطع فاكهة الأناناس الحقيقية. إنها ناعمة ومرنة للغاية. الجميع سوف يحبون هذه الحلوى.&lt;br&gt;&lt;/div&gt;&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;!-- cpt_container_end --&gt;', '', 'مصنع تشيز كيك', '', ''),
(49, 2, 'زهرة القرنبيط العضوية', '&lt;p&gt;أضيفي المزيد من القوة إلى نظامك الغذائي اليومي مع هذه البروكلي فلوريتس. هي لذيذة ولذيذة ومليئة بالتغذية وتساعد في الحفاظ على الصحة العامة للعظام والقلب. سواء كانت مقلية أو مطهوة على البخار ، فهذه الأزهار تعتبر علاجًا صحيًا للارتداء.&lt;br&gt;&lt;/p&gt;\r\n', '', 'زهرة القرنبيط العضوية', '', ''),
(56, 2, 'خبز أسمر', '&lt;p&gt;مصنوعة من حبوب القمح الكاملة 100 ٪ ، خبز القمح الكامل بريتانيا هو مصدر جيد للألياف والمواد الغذائية الأساسية. ناعمة ولذيذة ، استمتع بالخبز المحمص مع الشاي أو تحمصه على المقلاة لصنع قطع الخبز المحمص المقرمشة&lt;br&gt;&lt;/p&gt;', '', 'خبز أسمر', '', ''),
(57, 1, ' Eli\'s Health Loaf', '', '', ' Eli\'s Health Loaf', '', ''),
(59, 2, 'ساندويتش يخفف 100٪ من القمح الكامل', '', '', 'ساندويتش يخفف 100٪ من القمح الكامل', '', ''),
(58, 2, 'جيسيكا الموز البندق اللوف', '&lt;p&gt;كرانشي ، حلو لذيذ ولذيذ. يذوق أفضل عندما يكون محمص قليلاً ومملح. مصدر غني للطاقة. مثالي لاستخدامه كخلع الملابس على مختلف الأطباق الحلوة وأيضا لمجموعة من الوصفات.&lt;br&gt;&lt;/p&gt;', '', 'جيسيكا الموز البندق اللوف', '', ''),
(60, 2, 'ميني نان بريد', '&lt;p&gt;يتم بذل كل جهد للحفاظ على دقة جميع المعلومات. ومع ذلك ، قد تحتوي مواد ومواد التعبئة الفعلية على معلومات أكثر و / أو مختلفة. يوصى بعدم الاعتماد فقط على المعلومات المقدمة.&lt;br&gt;&lt;/p&gt;', '', 'ميني نان بريد', '', ''),
(42, 1, 'Red Seedless Grapes', '&lt;p&gt;&lt;font face=&quot;Helvetica&quot; size=&quot;2&quot;&gt;Red Globe grapes are uniquely large and round. They have large seeds, a crunchy skin and fleshy pulp and are pinkish red in color. These are mildly sweet and tasty. They are not as tangy as flame seedless or as sweet as Thompson seedless.&amp;nbsp;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;&lt;ul&gt;\r\n&lt;/ul&gt;\r\n', '', 'Red Seedless Grapes', '', ''),
(63, 2, 'التوقيع جرانولا سناك ميكس', '&lt;p&gt;استمتع برائحة القهوة الشهية وحلاوة الشوكولاتة مع بارلي هايد وكايك كافيه موكا كوكي. معبأة بمكسب من رقائق الشيكولاتة ، هذا البسكويت هو بالتأكيد متعة لجميع محبي القهوة والشوكولاته.&lt;br&gt;&lt;/p&gt;', '', 'التوقيع جرانولا سناك ميكس', '', ''),
(64, 2, 'فانتازيا الظلام شوكو يملأ الكعكة', '&lt;p&gt;يملأ شوكو فانتازيا مظلمة ما النعيم طعمه بالفعل. القشرة الغنية المخبوزة بالشمس تمنحك كريم شوكولاتة فاتر وسلس لإضفاء لمسة جمالية على براعم التذوق.&lt;br&gt;&lt;/p&gt;', '', 'Sunfeast Dark Fantasy Choco Fills Cookie', '', ''),
(66, 2, 'إخفاء N Seek ميلانو', '&lt;p&gt;علاج لبراعم الذوق الخاص بك ، يفسد في الاحتفالات الشيطانية عن طريق العض في Parle Hide &amp;amp; Seek Milano Chocolate Chip Cookies. لديها التوازن الدقيق من مقرمشة والشوكولاته. الطعم وفرحة يتدفق لدغة بعد لدغة. هناك سر بعد كل ميلانو ، مما يجعلها بشكل لا يصدق وبشكل فاخر في ظروف غامضة. تلميح رائع من هذه البسكويت والشوكولاتة لذيذ ولذيذ وجاهز ومقدد ليذوب في فمك.&lt;br&gt;&lt;/p&gt;', '', 'إخفاء N Seek ميلانو', '', ''),
(67, 2, 'رقائق التورتيا', '&lt;p&gt;كتلة من الخبز المحمص الذي عادة ما يتم قطعه قبل تناوله. يستخدم بشكل رئيسي في خبز التوست بالثوم.&lt;br&gt;&lt;/p&gt;', '', 'رقائق التورتيا', '', ''),
(68, 2, 'رقائق التورتيا مغرفة ', '&lt;p&gt;كتلة من الخبز المحمص الذي عادة ما يتم قطعه قبل تناوله. يستخدم بشكل رئيسي في خبز التوست بالثوم.&lt;br&gt;&lt;/p&gt;', '', 'رقائق التورتيا مغرفة ', '', ''),
(69, 2, 'مدراس بسكويت', '&lt;p&gt;كتلة من الخبز المحمص الذي عادة ما يتم قطعه قبل تناوله. يستخدم بشكل رئيسي في خبز التوست بالثوم.&lt;br&gt;&lt;/p&gt;', '', 'مدراس بسكويت', '', ''),
(70, 2, 'رقائق التورتيا العضوية', '&lt;p&gt;مصنوع من مزيج من الذرة البيضاء والصفراء. USDA العضوية. خالي من الغلوتين. موافق للشريعة اليهودية.&lt;br&gt;&lt;/p&gt;', '', 'رقائق التورتيا العضوية', '', ''),
(71, 2, 'جيدة رقائق  التورتيا', '&lt;p&gt;الاشياء الجيدة ، الجيدة نعتقد أن الطعام يجب أن يكون طعم جيد. نحن نؤمن أيضاً بأن كل شغف يمكن أن يكون راضياً عن الطعام الحقيقي. نحن لا نستخدم سوى مكونات صحية لخلق وجبة خفيفة فريدة ونكهة يمكنك أن تشعر بها جيدًا.الأطعمة الكاملة الكاملةالأسماك الطازجة ، بذور السمسم ، بذور عباد الشمس ، الكينوا.غير مصنعة من المكونات المهندسة جينيا .كل منتج طبيعي معتمد من الغلوتينمقدار نباتيخبر الصوديومترميز الكوشرمستشعرات خالية من الدهونلا MSG0g عبر الدهونالأصباغ الاصطناعية ، النكهات أو المواد الحافظة 18G الحبوب الكاملة&lt;br&gt;&lt;/p&gt;', '', 'جيدة رقائق  التورتيا', '', ''),
(72, 2, 'تشيكس ميكس ساوريج تراديكال سناك ميكس', '&lt;p&gt;مجرد حق المزيج! يقول براعم الذوق الخاص بك انهم يريدون شيئا لذيذا. عقلك يخبرك بالملل مع خيارات الوجبات الخفيفة العادية. يدك بشكل طبيعي يصل إلى كيس من Chex Mix و voila ... حنين وجبة خفيفة حلها. فقط Chex Mix يعطيك مجموعة لا يمكن التنبؤ بها لذيذ من الأشكال والأذواق والقوام في كل حفنة.&lt;br&gt;&lt;/p&gt;', '', 'تشيكس ميكس ساوريج تراديكال سناك ميكس', '', ''),
(73, 2, 'ذهبية حبة كاملة شيدر مخبوزة سناك المفرقعات', '&lt;p&gt;مصنوع من البسمات ودقيق القمح الكامل ، دقيق القمح المخصب (الطحين ، النياسين ، الحديد المنخفض ، ثيامين مونونيترات ، ريبوفلافين ، حمض الفوليك) ، الزيوت النباتية (الكانولا و / أو عباد الشمس) ، الجبن الشيدر ([حليب مثقف ، ملح ، إنزيمات] ، Annatto) ، الملح ، يحتوي على 2 في المائة أو أقل: مستخلص الخميرة ، النكهة الطبيعية ، الفلفل الحلو ، التوابل (الكرفس) ، صودا الخبز ، فوسفات أحادي الصوديوم ، البصل المجفف ، مستخلص Annatto للون.&lt;br&gt;&lt;/p&gt;', '', 'ذهبية حبة كاملة شيدر مخبوزة سناك المفرقعات', '', ''),
(30, 1, 'Fancy Mixed Nuts', '&lt;p&gt;\r\n	Crunchy, pleasantly sweet and delicious Tastes best when slightly roasted and salted Rich source of energy Ideal to be used as a dressing on various sweet dishes and also for a range of recipes&lt;/p&gt;\r\n', '', 'Fancy Mixed Nuts', '', ''),
(50, 2, 'شجر العليق - أجهزة البلاك بيري', '&lt;p&gt;&lt;font color=&quot;#333333&quot; face=&quot;Amazon Ember, Arial, sans-serif&quot; size=&quot;2&quot;&gt;الكشمش الأسود المجفف بالتجميد لدينا لا يضاف شيئا ويتم تجفيفه في ذروة الذروة. أي شخص لديه طعم لقضمة بيريليس سوف يستمتع بالكشمش الأسود. هذه التوت المجفف بالتجميد تقدم وجبة خفيفة لذيذة أو إضافة إلى الحبوب المفضلة. الكشمش الأسود يقدم الفيتامينات A و B و E و هي غنية بمضادات الأكسدة.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', '', 'شجر العليق - أجهزة البلاك بيري', '', ''),
(51, 2, 'فراولة', '&lt;p&gt;Aumfresh Freeze Dried Strawberry - 100٪ نقي وطبيعي ، 25 جم لا نكهة اصطناعية ولا مواد حافظة يمكن معالجتها بتقنية فريدة من نوعها منخفضة درجة الحرارة الباردة المجففة (LTCD) ويتم تسويقها في مكعبات ، رقائق ، شرائح ، حبيبات ومسحوق شكل - عند المقارنة مع تجفيف الشمس أو تجميد المجفف ، تم العثور على منتجاتنا لإعطاء جميع الصفات مثل اللون ، والنكهة ، ورائحة ، والذوق ، والجفاف ، والقيم الغذائية وزيادة الممتلكات على المدى الطويل إلى حد لا يمكن الاقتراب منه ، مما يجعلها قريبة جدا من تلك الطازجة ويجعل التكنولوجيا لدينا أفضل تكنولوجيا التجفيف في العصر الحالي. شركة Aumfresh ملتزمة بتوفير منتجات ذات جودة عالية. ثبت علميا أن فعالية المنتج تتأثر ببيئة المعالجة. تقوم Aumfresh بزراعة منتجاتها وحصادها ومعالجتها تحت رقابة صارمة وظروف شاملة. نحن نعمل مع الآلاف من المزارعين الأسريين الصغار في الهند لزراعة آلاف الأفدنة من الأراضي الزراعية العضوية المستدامة. عن طريق اختيار منتجات Aumfresh فأنت لا تحصل فقط على المادة الصلبة النقية ولكن أيضا الاهتزازات الروحية تشرب نانوسكوبي أثناء المعالجة. Aumfresh يثبت نفسه ليكون اختيارك الصحيح.&lt;br&gt;&lt;/p&gt;', '', 'فراولة', '', ''),
(52, 2, 'البيض العضوي البني', '&lt;p&gt;&lt;font color=&quot;#393939&quot; face=&quot;Open Sans, Helvetica Neue, Helvetica, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px; white-space: pre-wrap;&quot;&gt;خالية من القفص ، تغذية عضوية معتمدة ، بدون هرمونات أو مضادات حيوية&lt;/span&gt;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', '', 'البيض العضوي البني', '', ''),
(53, 2, 'حلويات ميكس', '&lt;p&gt;&lt;font color=&quot;#393939&quot; face=&quot;Open Sans, Helvetica Neue, Helvetica, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px; white-space: pre-wrap;&quot;&gt;مصنوعة من مزيج لذيذ من المكونات المختارة طعم أصيل مثالي للاستمتاع بشعبية حلوة من حليب سميك وكاراميل مثالي لإشباع الأسنان الحلوة.&lt;/span&gt;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', '', 'حلويات ميكس', '', ''),
(54, 2, 'البريتزل العضوي', '&lt;p&gt;بريتزيل كريسس هوني مسطرد &amp;amp; أمبير ؛ 38؛ البصل المفرقعات البريتزل هي تطور الحديثة على قديم مفضل. انهم &amp;amp; أمبير ؛ 39 ؛ إعادة أفضل جزء من البريتزل - كل نكهة وأزمة لكم - ولكن أخف كريسبير وأكثر تنوعا من أي وقت مضى. سواء كنت تحبهم سهل المنغمس أو يقترن مع توبكس المفضلة الخاصة بك العجائن المقرمشات هو متأكد أنت وأمبير ؛ 39 ؛ ليرة لبنانية تتمتع هذه وجبة خفيفة صحية كما يفعلون الكثير. One Bite And You &amp;amp; أمبير ؛ 39 ؛ Ll استمتع إعادة التفكير بك Pretzel.FeaturesProduct - العسل الخردل &amp;amp; أمبير ؛ 38؛ البصل البريتزل كراكرزكل طبيعيبديكديلي ستايلبنك 12 نت وزن - 7.2 أوقية .. أصلي مستورد من الولايات المتحدة الأمريكية. تشمل الأسعار استيراد الرسوم الجمركية والضرائب.&lt;br&gt;&lt;/p&gt;', '', 'البريتزل العضوي', '', ''),
(55, 2, 'صادقة كوكتيل الاطفال العضوية متنوعة', '&lt;p&gt;مزيج مثالي من الذوق والتغذية! Tropicana Pure Premium® Original هو عصير برتقال صافي 100٪ ، محشور من البرتقال الطازج ولم يسبق له مثيل. لا عجب أنها العلامة التجارية عصير البرتقال # 1.&lt;br&gt;&lt;/p&gt;', '', 'صادقة كوكتيل الاطفال العضوية متنوعة', '', ''),
(35, 1, 'Organic Red Delicious Apples', '&lt;p&gt;\r\n	Washington Apples are a natural source of fibre and are fat free. They contain anti-oxidants and polynutrients. The Calories of Washington Apple is 95. These Washington Apples are crisp, red, smooth-skinned, juicy fruits. The flesh of that apple tastes crispy and very juicy with a sugary-sweet flavor.&amp;nbsp;&lt;/p&gt;\r\n', '', 'Organic Red Delicious Apples', '', ''),
(48, 1, 'Dry Roasted Macadamia Nuts with Sea Salt', '&lt;div class=&quot;cpt_product_description &quot;&gt;\r\n	&lt;div&gt;\r\n		&lt;p&gt;&lt;b&gt;Healthy and delicious Rich in nutrition Can be added to pancakes, puddings, muffins, etc.Ideal snack to satiate hunger pangs&lt;/b&gt;&lt;br&gt;&lt;/p&gt;\r\n	&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;!-- cpt_container_end --&gt;', '', 'Dry Roasted Macadamia Nuts with Sea Salt', '', ''),
(40, 1, 'Roasted Whole Cashews', '&lt;p class=&quot;intro&quot;&gt;\r\n	Premium quality walnut kernels Great source of protein, fibre and antioxidants Nutty yet pleasantly sweet in taste Ideal for snacking, cooking and baking An excellent addition to desserts, shakes etc.&lt;/p&gt;\r\n', '', 'Roasted Whole Cashews', '', ''),
(28, 1, 'Cashew Cluster', '&lt;p&gt;Good source of protein. Good source of fiber. Gluten free.&amp;nbsp; Kosher&lt;br&gt;&lt;/p&gt;&lt;ul&gt;\r\n&lt;/ul&gt;\r\n', '', 'Cashew Cluster', '', ''),
(44, 1, 'Organic Bananas', '&lt;div&gt;\r\n	Bananas are one of the most budget-friendly, nutritious and widely eaten fruits and Fresho brings you a selection of the finest. Chosen from the best orchards across the country, these bananas are ripe and come with a vibrant yellow skin, which protects its nutrients&lt;/div&gt;\r\n', '', 'Organic Bananas', '', ''),
(45, 1, 'Trident Alaskan Salmon Burgers', '&lt;div class=&quot;cpt_product_description &quot;&gt;\r\n	&lt;div&gt;\r\n		&lt;p&gt;&lt;b&gt;Make the much-loved burgers using crispy McCain Veggie Burger Patty. Made from a fine blend of fresh vegetables and mashed potatoes, it is lightly seasoned with spices and coated with crispy bread crumbs. Fry, bake or grill the patty and treat yourself to a perfect burger.&lt;/b&gt;&lt;br&gt;&lt;/p&gt;\r\n	&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;!-- cpt_container_end --&gt;', '', 'Trident Alaskan Salmon Burgers', '', ''),
(74, 1, 'Cheese Pizza', '&lt;p&gt;Make the much-loved burgers using crispy McCain Veggie Burger Patty. Made from a fine blend of fresh vegetables and mashed potatoes, it is lightly seasoned with spices and coated with crispy bread crumbs.&amp;nbsp;&lt;br&gt;&lt;/p&gt;', '', 'Cheese Pizza', '', ''),
(75, 1, 'Angus Cheeseburger', '&lt;p&gt;Pierre Angus Cheeseburgers start with USDA choice beef that sets the standard for flavor, juiciness and tenderness. Flame broiled to perfection, our beef steak patties are complemented by a layer of American cheese and served on a Kaiser sesame-seed yeast roll--ready to serve in seconds. A smart choice for a busy lifestyle, Pierre\'s flame broiled, fully cooked Angus Cheeseburgers are sure to become your favorite! You get the goodness of grilling without the wait!&lt;br&gt;&lt;/p&gt;', '', 'Angus Cheeseburger', '', ''),
(76, 1, 'Egg and Cheese Croissant', '&lt;p&gt;Relish the delightful taste of lip-smacking McCain Potato Cheese Shotz, which is made from a flavoursome blend of potatoes, cheese and herbs seasoning. Coated in crunchy golden breadcrumbs, these taste best when served hot with mayo dip, Thai chilli sauce or much-loved Pudina Chutney.&lt;br&gt;&lt;/p&gt;', '', 'Egg and Cheese Croissant', '', ''),
(77, 2, ' أربعة جبن رافيولي', '', '', ' أربعة جبن رافيولي', '', ''),
(61, 1, 'Breakfast Sandwich Bread', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: Celias, Arial; font-size: 14px;&quot;&gt;Every effort is made to maintain accuracy of all information. However, actual product packaging and materials may contain more and/or different information. It is recommended not to solely rely on the information presented.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Breakfast Sandwich Bread', '', ''),
(47, 1, 'Mixed Bell Peppers', '&lt;p&gt;\r\n	Yellow Capsicums are three- or four-lobed fruits of the capsicum annum species. It thick walls enclose a large hollow and segments which their seeds are attached to. They are milder in flavor than many peppers and so are recognized as sweet peppers. These are a good resource of vitamins A and C and supply dietary fiber.&amp;nbsp;&lt;/p&gt;\r\n', '', 'Mixed Bell Peppers', '', ''),
(32, 1, 'Organic Fudge Bars', '&lt;p&gt;&lt;b&gt;Kwality Walls Creamy Delights Pineapple flavored frozen dessert is improved with real pineapple fruit chunks. It is very flexible and delightful flavor. Everyone will like this dessert.&lt;/b&gt;&lt;br&gt;&lt;/p&gt;\r\n', '', 'Organic Fudge Bars', '', ''),
(41, 1, 'Organic Peeled Carrots', '&lt;div&gt;\r\n	Fresho is our brand of fresh fruits and vegetables which are individually handpicked everyday by our experienced and technically competent buyers. Our buying, storing and packaging processes are tailored to ensure that only the fresh, nutrient dense, healthy and delicious produce reaches your doorstep. We guarantee the quality of all Fresho products. If you\'re not satisfied with the freshness of the items, you can hand them back to our Customer Experience Executive (CEE) for a full refund. Baby carrots are carrots that aren\'t fully grown. They are similar to normal carrots except that they are smaller in size.&amp;nbsp;&lt;/div&gt;\r\n', '', 'Organic Peeled Carrots', '', ''),
(34, 1, 'Gits Gulab Jamun Dessert Mix', '&lt;div&gt;&lt;b&gt;Deliciously soft and tempting, Gits Gulab Jamun Mix gives you a heavenly, melt-in-the mouth experience. Made with more milk solids, it prepares mouth-watering traditional gulab jamuns with authentic taste. Enjoy this hallmark dessert, ready in few minutes with this instant mix.&lt;/b&gt;&lt;br&gt;\r\n&lt;/div&gt;\r\n', '', 'Gits Gulab Jamun Dessert Mix', '', ''),
(43, 1, 'Campari Tomatoes', '&lt;div&gt;\r\n	&lt;p&gt;&lt;b&gt;Tomato is an amazingly popular and versatile food that comes in several different varieties that vary in shape, color and size. There are tiny cherry tomatoes, Italian pear-shaped tomatoes, bright yellow tomatoes, and the green tomato. Lycopene is the substance that provides tomatoes their rich red color and tomatoes are natures finest source of lycopene, which is a potent antioxidant and tomatoes cooked with a touch of oil give more lycopene than raw tomatoes.&amp;nbsp;&lt;/b&gt;&lt;br&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n', '', 'Campari Tomatoes', '', ''),
(62, 1, 'Chocolate Chunk Cookies', '&lt;p&gt;Light, crispy and crunchy cookies.Baked to perfection in an artisanal fashion.Lavishly loaded with nibbles of cashewnuts.Delicious distinctive golden-brown in colour.Makes for a satisfying snack or a delectable tea-time accompaniment.&lt;br&gt;&lt;/p&gt;', '', 'Chocolate Chunk Cookies', '', ''),
(31, 1, 'The Cheesecake Factory', '&lt;div class=&quot;cpt_product_description &quot;&gt;\r\n	&lt;div&gt;&lt;div&gt;Kwality Walls Creamy Delights Pineapple flavored frozen dessert is improved with real pineapple fruit chunks. It is very flexible and delightful flavor. Everyone will like this dessert.&lt;/div&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;!-- cpt_container_end --&gt;', '', 'The Cheesecake Factory', '', ''),
(49, 1, 'Organic Broccoli Florets', '&lt;p&gt;Add more power and punch to your daily diet with these Broccoli Florets. Hearty and delicious, they are packed with nutrition and helps in maintaining the overall health of bones and heart. Be it stir-fried or steamed, these florets are a healthy treat to binge on.&lt;br&gt;&lt;/p&gt;\r\n', '', 'Organic Broccoli Florets', '', ''),
(58, 1, 'Jessica\'s Banana Nut Loaf', '&lt;p&gt;Crunchy, pleasantly sweet and delicious.Tastes best when slightly roasted and salted.Rich source of energy.Ideal to be used as a dressing on various sweet dishes and also for a range of recipes.&lt;br&gt;&lt;/p&gt;', '', 'Jessica\'s Banana Nut Loaf', '', ''),
(60, 1, 'Mini Naan Bread', '&lt;p&gt;Every effort is made to maintain accuracy of all information. However, actual product packaging and materials may contain more and/or different information. It is recommended not to solely rely on the information presented.&lt;br&gt;&lt;/p&gt;', '', 'Mini Naan Bread', '', ''),
(63, 1, 'Signature Granola Snack Mix', '&lt;p&gt;Revel in the heavenly aroma of coffee and the sweetness of chocolates with Parle Hide and Seek Caffe Mocha Cookie. Packed with a bounty of chocolate chips, this biscuit is surely a delight for all coffee and chocolate lovers.&lt;br&gt;&lt;/p&gt;', '', 'Signature Granola Snack Mix', '', ''),
(65, 2, 'كعكة البندق الذواقة', '&lt;p&gt;مصنوعة من دقيق القمح محملة بالكاجو واللوز شهي ، صحية ولذيذة.&lt;br&gt;&lt;/p&gt;', '', 'كعكة البندق الذواقة', '', ''),
(66, 1, 'Hide N Seek Milano', '&lt;p&gt;A treat to your taste buds, spoil in devilish festivities by biting into Parle Hide &amp;amp; Seek Milano Chocolate Chip Cookies. It has the exact balance of crunchiness and chocolate. Taste and delight flows bite after bite. There is a secret following all Milano, making it equally unbelievably and mysteriously luxurious. A wonderful hint of these cookies and chocolate are yummy, tasty, ready and crunchy to melt in your mouth.&lt;br&gt;&lt;/p&gt;', '', 'Hide N Seek Milano', '', ''),
(70, 1, 'Organic Tortilla Chips', '&lt;p&gt;Made with a Blend of White and Yellow Corn. USDA Organic. Gluten-free. Kosher.&lt;br&gt;&lt;/p&gt;', '', ' Organic Tortilla Chips', '', ''),
(72, 1, 'Chex Mix Savory Traditional Snack Mix', '&lt;p&gt;Just the Right Mix!Your taste buds are saying they want something savory. Your mind is telling you it\'s bored with ordinary snack choices. Your hand naturally reaches into a bag of Chex Mix and voila...snack craving solved. Only Chex Mix gives you a deliciously unpredictable combination of shapes, tastes and textures in every handful.&lt;br&gt;&lt;/p&gt;', '', 'Chex Mix Savory Traditional Snack Mix', '', ''),
(73, 1, 'Goldfish Whole Grain Cheddar Baked Snack Crackers', '&lt;p&gt;Made with Smiles and Whole Wheat Flour, Enriched Wheat Flour (Flour, Niacin, Reduced Iron, Thiamine Mononitrate, Riboflavin, Folic Acid), Vegetable Oils (Canola and/or Sunflower), Cheddar Cheese ([Cultured Milk, Salt, Enzymes], Annatto), Salt, Contains 2 Percent or Less of: Yeast Extract, Natural Flavor, Paprika, Spices (Celery), Baking Soda, Monocalcium Phosphate, Dehydrated Onions, Annatto Extract for Color.&lt;br&gt;&lt;/p&gt;', '', 'Goldfish Whole Grain Cheddar Baked Snack Crackers', '', ''),
(51, 1, 'Strawberries', '&lt;p&gt;Aumfresh Freeze Dried Strawberry - 100% Pure &amp;amp; Natural, 25 gm No artificial flavour &amp;amp; No preservatives Can is processed with unique Advanced Low Temperature Cold Dried (LTCD) technology and are marketed in Cubes, Flakes, Strips, Granules and Powder form -when compared with sun dried or freeze dried , our products are found to yield all the qualities like color, flavor, aroma, taste, rehydration, nutritional values and increased shelf life property to an unmatchable extent taking it very close to the fresh ones and makes our technology the best drying technology of the present era. Aumfresh is committed to supply quality products. It is scientifically proved that efficacy of a product is influenced by the processing environment. Aumfresh cultivates, harvests and processes its products under strict surveillance and holistic conditions. We work with thousands of small family farmers in India to cultivate thousands of acres of sustainable organic farm land. By choosing Aumfresh products you are not only getting pure solid matter but also spiritual vibrations imbibed nanoscopically during processing. Aumfresh proves itself to be your right choice.&lt;br&gt;&lt;/p&gt;', '', 'Strawberries', '', ''),
(52, 1, 'Organic Brown Eggs ', '&lt;p&gt;&lt;span style=&quot;color: rgb(57, 57, 57); font-family: &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, sans-serif; font-size: 14px; white-space: pre-wrap;&quot;&gt;Cage Free, Certified Organic Feed, No Hormones or Antibiotics&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Organic Brown Eggs ', '', ''),
(54, 1, 'Organic Pretzel Crisps', '&lt;p&gt;Pretzel Crisps Honey Mustard &amp;amp;Amp;38; Onion Pretzel Crackers Are A Modern Twist On An Old Favorite. They&amp;amp;Amp;39;Re The Best Part Of The Pretzel--All The Flavor And Crunch You Love--But Lighter Crispier And More Versatile Than Ever Before. Whether You Like Them Plain Dipped Or Paired With Your Favorite Toppings Pretzel Crisps Is Sure You&amp;amp;Amp;39;Ll Enjoy This Wholesome Snack As Much As They Do. One Bite And You&amp;amp;Amp;39;Ll Enjoy Rethink Your Pretzel.FeaturesProduct - Honey Mustard &amp;amp;Amp;38; Onion Pretzel CrackersAll NaturalBakedDeli StylePack Of 12Net Weight - 7.2 Oz.. Genuine Imported Products from USA. Prices include Import Custom Duties and Taxes.&lt;br&gt;&lt;/p&gt;', '', 'Organic Pretzel Crisps', '', ''),
(55, 1, 'Honest Kids Organic Variety Juice Pack', '&lt;p&gt;The perfect combination of taste and nutrition! Tropicana Pure Premium® Original is 100% pure orange juice, squeezed from fresh-picked oranges and never from concentrate. No wonder it’s the #1 orange juice brand.&lt;br&gt;&lt;/p&gt;', '', 'Honest Kids Organic Variety Juice Pack', '', ''),
(68, 1, ' Multigrain Tortilla Scoop Chips', '&lt;p&gt;A Shaped Mass Of Baked Bread That Is Usually Sliced Before Eating.Its Mainly Used For Garlic Toast.&lt;br&gt;&lt;/p&gt;', '', ' Multigrain Tortilla Scoop Chips', '', ''),
(59, 1, ' Sandwich Thins 100% Whole Wheat', '', '', ' Sandwich Thins 100% Whole Wheat', '', ''),
(69, 1, ' Madras Biscuits', '&lt;p&gt;A Shaped Mass Of Baked Bread That Is Usually Sliced Before Eating.Its Mainly Used For Garlic Toast.&lt;br&gt;&lt;/p&gt;', '', ' Madras Biscuits', '', ''),
(77, 1, ' Seviroli Four Cheese Ravioli', '', '', ' Seviroli Four Cheese Ravioli', '', ''),
(56, 1, ' Whole Wheat Bread', '&lt;p&gt;Made from 100% whole wheat grains, Britannia\'s Whole Wheat Bread is a good source of fibre and essential nutrients. Soft and delicious, enjoy toasted bread with tea or roast it on pan for making crunchy croutons&lt;br&gt;&lt;/p&gt;', '', ' Whole Wheat Bread', '', ''),
(36, 1, 'Almond &amp; Brownie Frozen Dessert', '&lt;div&gt;\r\n	&lt;p&gt;&lt;b&gt;kwality walls Magnum - Mini Classic, Almond &amp;amp; Brownie Frozen Dessert&lt;/b&gt;&lt;br&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n', '', 'Almond &amp; Brownie Frozen Dessert', '', ''),
(50, 1, 'Blackberries', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;Our freeze-dried black currants have nothing added and are dried at peak freshness. Anyone with a taste for berryliscious tartness will greatly enjoy black currants. These freeze-dried berries make a yummy snack or addition to a favorite cereal. Black currants offer vitamins A, B and E and are rich in antioxidants.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Blackberries', '', ''),
(53, 1, 'Gits Basundi Dessert Mix', '&lt;p&gt;&lt;font color=&quot;#393939&quot; face=&quot;Open Sans, Helvetica Neue, Helvetica, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px; white-space: pre-wrap;&quot;&gt;Made from a luscious combination of choicest ingredients Authentic taste Ideal to relish popular sweet of thickened and caramelized milk Perfect to satiate a sweet tooth.&lt;/span&gt;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', '', 'Gits Basundi Dessert Mix', '', ''),
(71, 1, 'Good Multigrain Tortilla Chips', '&lt;p&gt;The Good, Good StuffWe believe food should taste good. We also believe every craving can be satisfied with real food.We use nothing but wholesome ingredients to create a unique and flavorful snack you can feel good about.Real Whole FoodsFlax Seeds, Sesame Seeds, Sunflower Seeds, Quinoa.Not made with genetically engineered ingredients.All NaturalCertified Gluten-FreeCertified VeganLow SodiumCertified KosherCholesterol Free FoodNo MSG0g Trans FatNo Artificial Colors, Flavors or Preservatives18g Whole Grain&lt;br&gt;&lt;/p&gt;', '', 'Good Multigrain Tortilla Chips', '', ''),
(65, 1, 'Sunfeast Delishus Nut Biscotti Gourmet Cookie', '&lt;p&gt;Made from wheat flour Loaded with cashews and almonds Scrumptious, healthy and delectable.&lt;br&gt;&lt;/p&gt;', '', 'Sunfeast Delishus Nut Biscotti Gourmet Cookie ', '', ''),
(64, 1, 'Sunfeast Dark Fantasy Choco Fills Cookie', '&lt;p&gt;Sunfeast Dark Fantasy Choco Fills depicts what bliss actually tastes like. The sun-baked rich crust enrobes the luscious and smooth choco creme made to mesmerise the taste buds.&lt;br&gt;&lt;/p&gt;', '', 'Sunfeast Dark Fantasy Choco Fills Cookie', '', ''),
(67, 1, 'Multigrain Tortilla Chips', '&lt;p&gt;A Shaped Mass Of Baked Bread That Is Usually Sliced Before Eating.Its Mainly Used For Garlic Toast.&lt;br&gt;&lt;/p&gt;', '', 'Multigrain Tortilla Chips', '', '');
